function [y,u] = eval(k,varargin)% [y,units] = eval(SumObj,T,kUnits)% evaluates rate coefficient at given T%% y = eval(k,T,kUnits)  e.g., kUnits = {'cm3/molecule','s'}% y = eval(k,T)         in cm3/mol/s% Copyright 1999-2010 Michael Frenklach% $Revision: 1.0 $% Last modified: May 7, 2010if isSameClass(k)   kCellArray = k.Values;   [y,u] = sum([kCellArray{:}],varargin{:});else   error('k''s of different classes cannot be summed')end